def log_message(message):
    timestamp = datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    log_entry = f"[{timestamp}] {message}"
    print(log_entry)
    try:
        log_path = os.path.join(os.path.dirname(os.path.abspath(__file__)), LOG_FILE)
        with open(log_path, "a", encoding="utf-8") as f:
            f.write(log_entry + "\n")
    except: pass

def is_admin():
    try: return ctypes.windll.shell32.IsUserAnAdmin()
    except: return False

def run_as_admin():
    script = os.path.abspath(sys.argv[0])
    params = ' '.join([f'"{arg}"' for arg in sys.argv[1:]]) + " as-admin"
    ctypes.windll.shell32.ShellExecuteW(None, "runas", sys.executable, f'"{script}" {params}', None, 1)

def install():
    try:
        log_message("--- Installation started ---")
        
        stl_path = os.path.expandvars(r"%ProgramFiles%\UltiMaker Cura 5.11.0\share\cura\resources\meshes\print_bed_makerbot_replicator_z18.stl")
        os.makedirs(os.path.dirname(stl_path), exist_ok=True)
        with open(stl_path, "wb") as f:
            f.write(base64.b64decode(STL_BASE64))
        log_message(f"STL file successfully extracted to {stl_path}")
        
        for raw_path, content in USER_FILES.items():
            path = os.path.expandvars(raw_path)
            os.makedirs(os.path.dirname(path), exist_ok=True)
            
            if os.path.exists(path):
                backup = path + "_old"
                if os.path.exists(backup):
                    os.remove(backup)
                os.rename(path, backup)
                log_message(f"BACKUP: {backup}")

            with open(path, "w", encoding="utf-8") as f:
                f.write(content)
            log_message(f"INSTALL: {path}")

        log_message("--- Installation complete ---")
    except Exception:
        log_message("A FATAL ERROR HAS OCCURRED:")
        log_message(traceback.format_exc())

if __name__ == "__main__":
    if is_admin():
        install()
        print("\n" + "="*30)
        input("The process has finished. Press Enter to close...")
    else:
        print("Requesting administrator rights...")
        run_as_admin()
